import React from "react";

import Header from "../components/Header";
import About from "../components/About";
import Project from "../components/Project";
import Contact from "../components/Contact";

const HomeView = () => {

  return (
    <>
      <Header />
      <About />
      <Project />
      <Contact />
    </>
  );
};

export default HomeView;
